import React from 'react';
import './App.css';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import {  Link } from 'react-router-dom';
import classScreen from './_screens/classScreen';
import homeScreen from './_screens/homeScreen';
import myLessonScreen from './_screens/myLessonScreen';
import history from './_store/history';

class App extends React.Component {
  render(){
    return (


      <Router history={history}>
        <div>
          <ul className="uul">
              <li className="lii">
               <Link className="linn" to="/">huviar</Link>
              </li>
              <li className="lii">
               <Link className="linn" to="/Home">Home</Link>
              </li>
              <li className="lii">
              <a class="asd">asdf</a>
              </li>

          </ul>
          <Switch>
              <Route path="/" exact component={classScreen} />
              <Route path="/Home" component={homeScreen} />
              <Route path="/Lesson" component={myLessonScreen} />
          </Switch>
         </div>
      </Router>
    );
  }
}
export default App;
